import { useEffect } from 'react';

/**
 * トップ画面
 * @returns
 */
function Top() {
	useEffect(() => {
		document.title = 'ShareJob';
	}, []);
	return (
		<div>
			<h1>shareJobへようこそ!</h1>
		</div>
	);
}

export default Top;
